import React, { useEffect } from 'react';
import Particles from 'react-tsparticles';
import "../../index.css"

const ParticleComponent = () => {
    useEffect(() => {
        // No need for additional initialization logic since react-tsparticles handles it internally
    }, []);

    return (
        <div id="tsparticles">
            <Particles
                id="tsparticles"
                options={{
                    background: {
                        color: {
                            value: "#333333",
                            opacity:1
                        }
                    },
                    fullScreen:{
                        enable:true,
                        zIndex:0,
                    },
                    interactivity:{
                        detectsOn:window,
                        events:{
                            onDiv:{
                                enable:false,
                                typeof:"circle"
                            },
                            onHover:{
                                enable:false,
                                parallax:{
                                    enable:false,
                                    force:2,
                                    smooth:10
                                }
                            }
                        }
                    },
                        name:"snow",
                        detectRetina:true,
                        duration:0,
                        fpsLimit:120,
                        motion:{
                            enable:true,
                        },
                    particles: {
                        bounce:{
                            horizontal:{
                                value:1
                            },
                            vertical:{
                                value:1
                            }
                        },
                        collisions:{
                            absorb:{
                                speed:2
                            },
                            bounce:{
                                horizontal:{
                                    value:1
                                },
                                vertical:{
                                    value:1
                                }
                            },
                            enable:false,
                            maxSpeed:50,
                            mode:"bounce"
                        },
                        color: {
                            value: "#fff",
                            animation:{
                                h:{
                                    count:5,
                                    enable:true,
                                    speed:2,
                                    sync:true
                                },
                                s:{
                                    count:5,
                                    enable:true,
                                    speed:2,
                                    sync:true
                                },
                                l:{
                                    count:5,
                                    enable:true,
                                    speed:2,
                                    sync:true
                                }
                            }
                        },
                        number: {
                            density:{
                                enable:true,
                                width:1920,
                                height:1080
                            },
                            value:400
                        },
                        size: {
                            value: 3
                        },
                        move: {
                            angle:{
                                offset:0,
                                value:90
                            },
                            attract:{
                                distance:200,
                                enable:false,
                                rotate:{
                                    x:3000,
                                    y:3000
                                }
                            },
                            center:{
                                x:50,
                                y:50,
                                mode:'percent',
                                radius:2
                            },
                            direction:'bottom',
                            enable:true,
                            gravity:{
                                acceleration:9.81,
                                maxSpeed:50
                            },
                            path:{
                                clamp:true,
                            },
                            outModes:{
                                default:'out'
                            },
                            speed:2,
                            straight:true,
                        },
                        shadow:{
                            color:{
                                value:"#000"
                            },
                        }

                    }
                }}
            />
        </div>
    );
};

export default ParticleComponent;
